CREATE TABLE pit_neighborhoods
(
    gid        SERIAL
        PRIMARY KEY,
    objectid   SMALLINT,
    fid_blockg SMALLINT,
    statefp10  VARCHAR(2),
    countyfp10 VARCHAR(3),
    tractce10  VARCHAR(6),
    blkgrpce10 VARCHAR(1),
    geoid10    VARCHAR(12),
    namelsad10 VARCHAR(13),
    mtfcc10    VARCHAR(5),
    funcstat10 VARCHAR(1),
    aland10    INTEGER,
    awater10   INTEGER,
    intptlat10 VARCHAR(11),
    intptlon10 VARCHAR(12),
    shape_leng NUMERIC,
    fid_neighb SMALLINT,
    perimeter  NUMERIC,
    neighbor_  SMALLINT,
    neighbor_i SMALLINT,
    hood       VARCHAR(25),
    hood_no    SMALLINT,
    acres      NUMERIC,
    sqmiles    NUMERIC,
    dpwdiv     SMALLINT,
    unique_id  SMALLINT,
    sectors    SMALLINT,
    shape_le_1 NUMERIC,
    shape_ar_1 NUMERIC,
    page_numbe SMALLINT,
    plannerass VARCHAR(48),
    created_us VARCHAR(3),
    created_da DATE,
    last_edite VARCHAR(3),
    last_edi_1 DATE,
    temp       VARCHAR(1),
    pghdb_sde_ NUMERIC,
    globalid   VARCHAR(36),
    shape__are NUMERIC,
    shape__len NUMERIC,
    geom       geometry(MultiPolygon, 4326)
);

ALTER TABLE pit_neighborhoods
    OWNER TO postgres;

CREATE INDEX pit_neighborhoods_geom_idx
    ON pit_neighborhoods USING gist (geom);

